import axios from 'axios';

const BOARD_API_BASE_URL = "http://localhost:8080/boards/list";

class ApiService{
    fetchWebBoards(){
        const result = axios.get(BOARD_API_BASE_URL);
        console.dir(result);
        return result;
    }
}

export default new ApiService();
